import { UPDATE_EMAIL } from "../actions/action-types";


const emailState = {
    email: '',
    emailError:'',
    isTouchedEmail: false,
}



export default function taxYearReducer(state = emailState, action) {
    switch( action.type ) {
        case UPDATE_EMAIL: 
            return action.payload 

        default:
            return state;
    }
};
